import React from "react";
import './'

const AgendaMedica: React.FC = () => {
  // Aqui você pode definir a lógica para obter os dados da agenda médica do backend

  // Dados de exemplo
  const appointments = [
    {
      id: 1,
      patientName: "Maria Santos",
      procedure: "Consulta Geral",
      time: "09:00",
      duration: "30min",
      color: "blue",
      value: "R$ 100,00",
    },
    {
      id: 2,
      patientName: "João Silva",
      procedure: "Exame de Sangue",
      time: "10:00",
      duration: "1h",
      color: "green",
      value: "R$ 80,00",
    },
    // Outros agendamentos...
  ];

  return (
    <div>
      <h2>Agenda Médica</h2>
      <table>
        <thead>
          <tr>
            <th>Hora</th>
            <th>Paciente</th>
            <th>Procedimento</th>
            <th>Duração</th>
            <th>Valor</th>
          </tr>
        </thead>
        <tbody>
          {appointments.map((appointment) => (
            <tr
              key={appointment.id}
              style={{ backgroundColor: appointment.color }}
            >
              <td>{appointment.time}</td>
              <td>{appointment.patientName}</td>
              <td>{appointment.procedure}</td>
              <td>{appointment.duration}</td>
              <td>{appointment.value}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AgendaMedica;
